import EventCard from './EventCard';

const events = [
  { title: 'Charlie Chaplin Show', img: '/events/chaplin.jpg' },
  { title: 'Peppa Pig Day Out', img: '/events/peppa.jpg' },
  { title: 'Mystery DJ Night', img: '/events/dj.jpg' },
  { title: 'Local Street Market', img: '/events/market.jpg' },
];

export default function PopularEvents() {
  return (
    <div className="mt-10">
      <div className="flex justify-between items-center mb-4">
        <h2 className="text-xl font-semibold">Popular Events</h2>
        <a href="#" className="text-blue-500 hover:underline text-sm">See all events</a>
      </div>
      <div className="grid grid-cols-2 sm:grid-cols-4 gap-4">
        {events.map((e, i) => (
          <EventCard key={i} title={e.title} img={e.img} />
        ))}
      </div>
    </div>
  );
}
